/* (Author: Tytrez Dixon; Date: 1/26/2025) This .tsx files contains a function for a single vehicle
entry. In this case, a vehicle entry consists of an image of a vehicle, specific
information regarding the vehicle, and a message asking if the salesperson wants
to purchase the vehicle. This function is used in the "Vehicle Specs.tsx" file. 

NOTE: THIS CODE WILL BE CHANGED LATER TO ACCOMODATE THE VEHCILE DATABASE!

*/

import React from "react";

export function SingleVehicleEntry () {
    return (
        <div>

            {/* Image of the vehicle.*/}
            <img
                src = "https://www.carscoops.com/wp-content/uploads/webp/2022/12/2022-Jaguar-XE.webp"
                width = {250}
                height = {250}    
                >
            </img>

            <div>
                {/* THIS SECTION OF CODE WILL BE CHANGED LATER TO INCLUDE ACTUAL VEHICLE INFO! */}
                <p>
                    [Specific Info]
                </p>
            </div>

            {/* Ask the salesperson whether or not they want to purcase the vehicle. */}
            <div>
                Purchase Vehicle?
            </div>

        </div>

    )
}
